import React, { useEffect, useState } from "react";

import { useParams } from "react-router";
import userService from "../../Appservices/App.service";

const Event = () => {
  const { id } = useParams();

  const [event, setEvent] = useState(null);

  useEffect(() => {
    async function fetchResults() {
      try {
        const response = await userService.get("events", id);

        if (response.data) {
          setEvent(response.data.item);
          console.log(response.data.item);
        }
      } catch (e) {
        console.log(e);
      }
    }

    fetchResults();
  }, [id]);

  return <div>{event && event.description}</div>;
};

export default Event;
